Охлаждающий спрей Wahl Blade Icе

Высокоэффективный охлаждающий спрей "4 в 1":
✔️ мгновенно охлаждает;
✔️ очищает;
✔️ предотвращает коррозию и износ ножей;
✔️ смазывает (смазывающие компоненты дополняют, но не заменяют масло).
Благодаря сильному давлению в баллоне и тонкой трубке, спрей моментально охладит и эффективно удалит волоски между ножами!

Объем 400 мл.

