Масло для бороды DapperDan 15 мл/50 мл

В составе продукта такие масла, как:
- Жожоба;
- Авокадо;
- Подсолнечное;
- Экстракт виноградной косточки;
- Облепиха.

Эта роскошная смесь масел смягчает, увлажняет и питает волосы бороды, а также кожу лица.

Аромат ванили и диптерикса душистого успокаивает и повышает настроение.

